INSERT INTO `posts` (`id`, `id_creator`, `role`, `title`, `body`, `view_count`, `created_at`, `updated_at`) VALUES
(1, 1, '0', 'buatan-admin', '<h3>Visi</h3>\r\n<p>Menjadi Lembaga Pendidikan yag bermutu dan berwawasan Internasional dengan lulusan yang mantap dalam imtaq, unggul dalam iptek, berprestasi serta siap bersaing dalam menghadapi tantangan Global.</p>\r\n<h3>Misi</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Menghasilkan tamatan yang memiliki ketaqwaan yang tinggi kepada tuhan yang maha esa dan memiliki kesadaran yang tinggi terhadap keharmonisan lingkungannya.</li>\r\n<li>Menghasilkan tamatan yang memiliki kompetensi tinggi, mampu bersaing di pasar tenaga kerja Nasional dan Internasional.</li>\r\n<li>Menghasilkan tamatan yang mampu memenuhi tuntutan ilmu Pengetahuan dan Teknologi sebagai bekal untuk mengembangkan dirinya.</li>\r\n<li>Menyelenggarakan Pendidikan Dan Pelatihan di bidang Teknologi bagi Masyarakat.</li>\r\n</ol>', 13, '2017-09-06 14:54:06', '2017-09-13 12:58:16'),
(2, 1, '0', 'kedua', '<p>asal</p>\r\n<p>ad</p>\r\n<p>ad</p>\r\n<p>as</p>\r\n<p>d</p>\r\n<p>asd</p>\r\n<p>&nbsp;</p>', 12, '2017-09-07 21:21:30', '2017-09-08 16:31:18'),
