(4, 1, '0', 'gggggggggggggggggggg-ini-judul', '<p>ad</p>\r\n<p>as</p>\r\n<p>d</p>\r\n<p>asd</p>\r\n<p>as</p>\r\n<p>das</p>\r\n<p>as</p>\r\n<p>d</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>asdasd</li>\r\n<li>asdasd</li>\r\n<li>as</li>\r\n<li>das</li>\r\n<li>d</li>\r\n<li>asd</li>\r\n<li>as</li>\r\n<li>d</li>\r\n<li>asd</li>\r\n<li>as</li>\r\n<li>das</li>\r\n<li></li>\r\n</ul>', 1, '2017-09-13 13:41:44', '2017-09-13 13:41:45');
